import ComA from './ComA'

const FirstName = createContext();
const LastName = createContext();


const App =()=>{
return (
    <>
    <FirstName.Provider value={'umar'}>
      <LastName.Provider value={'bashir'}>
         <ComA />
      </LastName.Provider>
    </FirstName.Provider>

    </>
    )
}
export default App;
export {FirstName};
export {LastName};
